INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (0, N'AccessMode', N'Prüft den AccessMode', CAST(N'2017-05-10' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (1, N'ClusterCommand', N'Prüft die Cluster Befehle am Master(Achtung die Service Schnittstelle muss am Master sein)', CAST(N'2015-03-09' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (2, N'ClusterFreezeValve', N'Es werden seperat alle Slaves gefreezed und seperat Betrieben. Es wird kontrolliert ob alle nicht gefreezten Ventile dem Master folgen', CAST(N'2015-04-13' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (3, N'ClusterSimpleFunction', N'Testet eine andauernde Open/Close und Positionierungsroutine im Cluster Betrieb(Achtung die Service Schnittstelle muss am Master sein)', CAST(N'2014-11-07' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (4, N'CommandHike', N'Testet ob der Hike define eingeschaltet ist', CAST(N'2017-04-27' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (5, N'CommandIC1', N'Testet alle IC1 Befehle. Es wird auf dem Service, RS232 Inrterface sowie RS485 Interface bei Half und Full Dublex überprüft. Achtung der User muss die Testbox RS232/RS485 Schalterstellung während dem Test bestätigen(Wenn nicht innerhalb von 5m wird der Test abgebrochen)', CAST(N'2014-11-26' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (6, N'CommandPM', N'Testet alle PM Befehle. Es wird auf dem Service, RS232 Inrterface sowie RS485 Interface bei Half und Full Dublex überprüft. Achtung der User muss die Testbox RS232/RS485 Schalterstellung während dem Test bestätigen(Wenn nicht innerhalb von 5m wird der Test abgebrochen)', CAST(N'2015-02-18' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (7, N'CommandPMAnswerOptions', N'Kontrolliert die Second Answer Enums bei den PM Befehlssätze Off, Pos, Pos/Prs. Weiter wird die Learn Antwort überprüft. Hier gibt es die Möglichkeit, dass sie direkt kommt oder nacht beendigung des Learns.', CAST(N'2016-05-10' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (8, N'CommandPMV2', N'Testet alle PMV2 Befehle. Es wird auf dem Service, RS232 Inrterface sowie RS485 Interface bei Half und Full Dublex überprüft. Achtung der User muss die Testbox RS232/RS485 Schalterstellung während dem Test bestätigen(Wenn nicht innerhalb von 5m wird der Test abgebrochen)', CAST(N'2015-01-22' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (9, N'CommandQ', N'Prüft die Q Befehle', CAST(N'2016-07-14' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (10, N'CommandService', N'Überprüft alle Command Services des Befehls(erste zwei Stellen des p: Befehls) auf dem Service sowie RS232 Kanal', CAST(N'2014-04-11' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (11, N'ControlMode', N'In jedem HomingStartOption werden alle möglichen Control Mode Übergänge überprüft (Momentan sind die Hardware Zustände noch nicht miteinbezogen). Es wird auch immer Überprüft ob der HomingEndControlMode eingehaltet wird. Zusätzlich wird noch der Zustand nach Neustart kontrolliert', CAST(N'2014-06-19' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (12, N'ControlModeH2', N'Langzeittest, bei welchem alle gültigen Control Modes gesetzt werden und zwischendurch ein Neustart erfolgt. Es wird auch noch geprüft ob bei einem Fehler die digitalen Ausgänge aktiv sind.', CAST(N'2016-10-11' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (13, N'ControlModeOnlyTransitions', N'In jedem HomingStartOption werden alle möglichen Control Mode Übergänge überprüft, aber ohne Neustarts (Momentan sind die Hardware Zustände noch nicht miteinbezogen). Es wird auch immer Überprüft ob der HomingEndControlMode eingehaltet wird.', CAST(N'2014-06-19' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (14, N'ControlModeShort', N'In jedem HomingStartOption werden alle möglichen Control Mode Übergänge überprüft (Momentan sind die Hardware Zustände noch nicht miteinbezogen). Es wird auch immer Überprüft ob der HomingEndControlMode eingehaltet wird. Zusätzlich wird noch der Zustand nach Neustart kontrolliert', CAST(N'2016-02-09' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (15, N'ControlModeWithNIHardware', N'In diesem Test werden alle Control Modes überprüft (Inklusive Interlocks und Safety Mode)', CAST(N'2015-06-18' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (16, N'ControlPositionRestriction', N'Der Control Position Restriction Service wird überprüft (Auf Einhaltung der Position Limiten im Pressure Control Mode)', CAST(N'2017-05-10' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (17, N'CrossoverHardSwitch', N'Beim HardSwitch wird der ganze SFS Bereich auf die richtige Nutzung des Sensors überprüft sowie den AlignemntOffset und CrossoverDelay Parameter miteinbezogen.', CAST(N'2014-07-14' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (18, N'CrossoverHardSwitchTest', N'Misst den Übergang bei einem Sensor Wechsel', CAST(N'2016-03-16' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (19, N'CrossoverPressureSetpoint', N'Pressure Setpoint Crossover wird der ganze SFS durchgegangen und auf die richtige Berechnung des Drucks geachtet im Position Mode. Weiter wird im Pressure Control kontrolliert ob der Pressure Setpoint definiert, welcher Sensor aktiv ist (Es kann ein ZeroAdjustOffset Wert mitgegeben werden).', CAST(N'2016-08-18' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (20, N'CrossoverSoftSwitch', N'SoftSwitch wird der ganze SFS durchgegangen und auf die richtige Berechnung des Drucks geachtet (Es kann ein ZeroAdjustOffset Wert mitgegeben werden).', CAST(N'2014-07-14' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (21, N'DataUnit', N'Überprüft alle Interface DeviceNet Objekte, welche DataUnit als Skalierer (Position/Pressure) haben (DataUnit umschalten -> Werte auf Veränderung kontrolieren)', CAST(N'2015-11-26' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (22, N'DeviceNetRampTime', N'Prüft auf dem DeviceNet das RampTime Objekt. Weiter wird auch das Sensor Delay Objekt geprüft', CAST(N'2015-11-24' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (23, N'EtherCATControlModeSequenz', N'Setzt alle Control Mode Setpoints über das EtherCAT Interface', CAST(N'2017-01-17' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (24, N'EtherCATFunctionSimple', N'Testet die Ansprechung der SDO und PDO Parameter über EtherCAT', CAST(N'2017-06-22' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (25, N'EtherCATFunctionTest', N'Testet Fehler Phanomene auf dem EtherCAT Interface', CAST(N'2016-07-08' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (26, N'EtherCATPositionSequenz', N'Fährt zufällige Position Sollwerte über das EtherCAT Interface an', CAST(N'2017-01-11' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (27, N'FileOverEtherCAT', N'Testet den Firmware Update über EtherCAT', CAST(N'2016-03-02' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (28, N'FirmwareDownload', N'Führt eine definierte Anzahl von Firmware Downloads nacheinander aus und prüft die PSS Nummer', CAST(N'2015-10-21' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (29, N'FirmwareDownloadAfterSDOCommunication', N'Führt einen Firmware Download durch und anschliessend werden SDO Werte gesetzt und wieder ausgelesen', CAST(N'2017-02-27' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (30, N'FunctionSimple', N'Es werden unterschiedliche Positions sowie Pressure Setpoints gesetzt. Dazwischen wird das Ventil noch geöffnet und geschlossen', CAST(N'2014-04-11' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (31, N'FunctionSimpleShort', N'Abgespeckte Version. Es werden unterschiedliche Positions sowie Pressure Setpoints gesetzt. Dazwischen wird das Ventil noch geöffnet und geschlossen.', CAST(N'2016-03-02' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (32, N'Homing', N'Einstellbare Homing Anzahl nacheinander(Kontrolliert zudem ob der Homing End Control Mode eingehalten wird)', CAST(N'2015-01-26' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (33, N'HomingRestart', N'Testet den Homing Vorgang nach Close und einem Restart sowie von Open aus und einem Restart.', CAST(N'2016-11-04' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (34, N'InterfaceServiceShift', N'Schaltet den Access Mode hin und her, dazu werden auch alle Interface Modes gesetzt.', CAST(N'2016-02-09' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (35, N'LearnCheckSum', N'Die einzelenen Learnbanken besitzen einen Checksumme, welche bei Neustart oder eines Learndaten Downloads auf richtigkeit überprüft wird. In diesem Test werden die Learn Daten manipuliert und geachtet, ob die Checksummen Fehler (Bit 1 Learn Warnungen) gesetzt wird', CAST(N'2015-11-11' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (36, N'LearnDataBank', N'Nachdem durchführen eines Learns wird geschaut, ob die Daten der zugewiesene Learnbank übertragen worden sind', CAST(N'2014-04-21' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (37, N'LearnDataCopy', N'Es wird mit jeder Learnbank ein Learn durchgeführt. Anschlissend werden die anderen Learnbanken mit Kopien versorgt. Jetzt werden alle Datenbanken auf Gleichheit überprüft. Am Schluss wird auch geprüft, ob mit den kopierten Learndaten eine Druckregelung möglich ist.', CAST(N'2017-05-10' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (38, N'LearnDeleteBankData', N'Testet den Delete All Learn Bank Service sowie den Delete Learn Bank der jeweiligen Learn Bank', CAST(N'2015-10-19' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (39, N'LearnOpenSpeed', N'Überprüft, ob der Open Speed bis zur zur halboffenen Position aktiv ist', CAST(N'2014-07-21' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (40, N'LearnPositionTable', N'Überprüft, ob die Reihenfolge der Positionstablle bei Neustart und bei Ausfführung eines Learn stimmt', CAST(N'2014-07-21' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (41, N'LearnPressureLimit', N'Schaut ob der Learn beim erreichen des Pressure Limit abbricht und diese Position nicht übernimt', CAST(N'2014-10-07' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (42, N'LearnSaveData', N'Führt einen Learn durch und schaut, ob diese Daten nach einem Neustart noch vorhanden sind', CAST(N'2017-05-10' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (43, N'LearnStart', N'Überprüft ob die Positionstabellen, wenn die Werte zuerst gesetzt werden auch nach dem Learn noch übereinstimmen(Auf allen 3 LearnBanken)', CAST(N'2014-08-05' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (44, N'LearnWriteData', N'Es werden die Learn Banken ohne Pause beschrieben bis ein 6D (EEProm not ready) auftritt', CAST(N'2016-09-23' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (45, N'LogicMode', N'Es wird der Logic Mode auf dem IC2H2 Controller geprüft. Die 4 definierten Positionen (CPA) werden je nachdem welcher Zustand die digitalen Eingänge haben angefahren', CAST(N'2016-10-18' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (46, N'LogicSimpleFunction', N'Über das Logik wird das Ventil gesteuert', CAST(N'2016-08-16' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (47, N'NVMemoryCheck', N'Liesst das NV Memory aus und vergleicht diese nach jedem Restart ob sich die Werte nicht verändert haben. Wird mit dem CRC Wert überprüft', CAST(N'2016-03-10' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (48, N'ObjectWithoutLogic', N'Prüft alle DeviceNet Objekte, welche direkt mit einem Parameter verknüpft sind und somit keine eigene Logik besitzen. Wie auch Objekt, die einen Konstanten Wert haben', CAST(N'2015-12-09' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (49, N'PFOFunctionCheck', N'Testet ob die PFO Funktionalität vorhanden ist. Der Endzustand sowie die Verzögerungszeit und den Power Fail Counter werden weiter überprüft.', CAST(N'2016-09-01' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (50, N'PFOMeasuredBatteryVoltage', N'Schreibt den letzten Battery Voltage Wert aus, bevor das Ventil die Kommunikation aufgibt. Diese Messung wird zu verschiedenen PFO Endpositionen und Delay Zeiten durchgeführt.', CAST(N'2017-02-20' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (51, N'Pinlifter', N'Definiert die einzelnen Pins und anschliessend werden die Motion Steps definiert. Anschliessend wird eine Sequenz gestartet.', CAST(N'2017-05-02' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (52, N'PositionControlSpeed', N'Fährt über den Position Bereich mit unterschiedlichen Geschwindigkeiten und vergleicht die Zeiten(Doppelte Geschwindigkeit -> halbe Zeit)', CAST(N'2015-03-06' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (53, N'PositionHoming', N'Führt bei jeder Position ein Homing aus', CAST(N'2015-05-28' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (54, N'PositionOverUndershoot', N'Schaut ob Über- oder Unterschwinger im Position Mode vorkommen. Dabei wird der Positionssollwert immer erreicht', CAST(N'2017-05-19' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (55, N'PositionRampSlope', N'Überprüft die Position Ramp Funktion Slope. Über den Parameter Slope wird die Steigung der Rampe definiert. Die Zeit, welche die Rampe braucht ist jetzt abhängig von der Steigung sowie vom Positionsdifferenz(Aktuellem zur Zielposition). Es werden alle möglichen Kombinationen RampSlope und RampType kontrolliert', CAST(N'2016-07-19' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (56, N'PositionRampTime', N'Überprüft die Position Ramp Funktion Time. Über den Parameter Time wird die Zeit definiert, welche die Rampe vom aktuellen bis zur Zielposition hat. Es werden alle möglichen Kombinationen von RampTimeIndex sowie RampType kontrolliert', CAST(N'2016-07-18' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (57, N'PositionRestart', N'Führt bei jeder Position ein Neustart aus', CAST(N'2014-11-11' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (58, N'PositionSetpointReceipt', N'Es wird kontrolliert, ob nach erhalt des Setpoint sich das Ventil bewegt. Es wird nicht gewartet, bis die Position erreicht wurde.', CAST(N'2017-02-06' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (59, N'PositionSpeedChangeDuringOperation', N'Es wird kontrolliert, ob nach erhalt des Setpoint das sich Ventil bewegt. Es wird nicht gewartet, ob die Position erreicht wurde und innerhalb der Bewegung wird die Geschwindigkeit geändert', CAST(N'2016-12-20' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (60, N'PowerConnectorIO', N'Testet die Interlock Eingaenge auf dem Power Connector', CAST(N'2017-03-29' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (61, N'PressureRampSlope', N'Überprüft die Ramp Funktion Slope. Über den Parameter Slope wird die Steigung der Rampe definiert. Die Zeit, welche die Rampe braucht ist jetzt abhängig von der Steigung sowie vom Druckdifferenz(Aktuellem zum Zieldruck). Es werden alle möglichen Kombinationen von Control Unit, Learnbank, ControlAlgorithm, RampSlope sowie RampType kontrolliert', CAST(N'2014-07-08' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (62, N'PressureRampSlopeMeasurement', N'Misst die Ramp Slope Zeit und schreibt sie in den Report', CAST(N'2016-06-21' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (63, N'PressureRampTime', N'Überprüft die Ramp Funktion Time. Über den Parameter Time wird die Zeit definiert, welche die Rampe vom aktuellen bis zum Zieldruck hat. Es werden alle möglichen Kombinationen von Control Unit, Learnbank, ControlAlgorithm, RampTimeIndex sowie RampType kontrolliert', CAST(N'2014-07-08' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (64, N'RandomPositionCloseRestart', N'Ablauf: Zufällige Position Sollwert anschliessend folgt ein Neustart. Wird dieser Vorgang 20 mal wiederholt, so folgt ein Close mit Restart. Dieser Ablauf wird mehrmals ausgeführt.', CAST(N'2016-04-12' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (65, N'RandomPositionTimeAndSetpoint', N'Die Zeit zwischen den Position Setpoint wird zufällig bestimmt. Maximum der Zeit ist auf die Ausführungszeit zwischen Position 0 und 100 definiert. Es wird kontrolliert, ob nach erhalt des Setpoint das sich Ventil bewegt. Dazu werden Acceleration, Deceleration, Jerk Limit und Position Control Speed zufällig gesetzt', CAST(N'2016-04-04' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (66, N'SafetyMode', N'Safety Control Mode erzwingen(Input Enable wird ausgeschaltet). Anschliessend wird überprüft, ob nach dem Safety in den Position Control Mode gewechselt wird(Dazwischen führt das Ventil einen Homing durch)', CAST(N'2016-01-06' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (67, N'ScalerService', N'Prüft die Service Group A-B Scaler(Position, Pressure)', CAST(N'2015-02-23' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (68, N'ScalingServiceRS232Interface', N'Schaut ob die Skalierung vom Interface bezüglich Service unabhängig sind und die richtigen Werte ausgelesen werden', CAST(N'2014-09-16' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (69, N'SensorFilter', N'Schaltet den Filter des Sensor ein und überprüft, ob die Verzögerungszeit eingehalten wird', CAST(N'2014-04-17' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (70, N'SensorInputSourceAnalog', N'Es werden die Druckpositionen auf Gleichheit überprüft, welche zuerst mit der Simulation gemessen werden und anschliessend mit der Analogen Sensoreingangsquelle erreicht wurden.', CAST(N'2016-10-20' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (71, N'SerialSend2Commands', N'2 Befehle gleichzeitig versenden und Antwort auf Gültigkeit überprüfen.(Remote/Open)', CAST(N'2014-04-09' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (72, N'SerialSend9TestValues', N'Test: 9 Befehle gleichzeitig, 6 Testvariablen werden gesetzt und 3 abgefragt (Es werden die 9 Testvariablen von Bool bis SINT64 verwendet)', CAST(N'2014-04-09' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (73, N'SerialSendWithLowBaudrate', N'Sendet alle Service Commands über das RS232 Interface. Dabei wird der Overflow Counter kontrolliert, ob er drastisch ansteigt (Problem Vergangenheit)', CAST(N'2017-04-25' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (74, N'ServicesStoreRestoreUserParameters', N'Prüft den Restore User Parameter Service sowie Restore Factory Default', CAST(N'2015-10-05' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (75, N'SettingLockMode', N'Prüft den Setting Lock Mode Service', CAST(N'2015-09-16' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (76, N'SettingsRS232Communication', N'Es werden alle möglichen Baudraten, Stop Bit, Parity Bit und Datenlängen eingestellt und mit Hilfe der Testvariablen verifiziert', CAST(N'2014-05-06' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (77, N'SingleStageControllerSimpleFunction', N'Langzeittest, welcher zwischen Position und Druck Regelung hin und her wechselt', CAST(N'2015-11-17' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (78, N'Statistic', N'Es werdem die System sowie Valve Statistic Parameters getestet. Ob die Spezifikation sowie der Reset über den ResetStatisticParameters Parameter eingehalten wird. Achtung: Es muss ein dichtschlissendes Ventil sein!', CAST(N'2014-07-21' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (79, N'StepDirMode', N'Testet die StepDir Funktion auf dem Onboard Inrterface. Es werden alle Schritte von Position 0 bis offen und wieder zurück über die digitalen Eingänge ausgeführt. Überprufueng der Position nach einem Homing im StepDir Mode', CAST(N'2016-10-11' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (80, N'StoreControlParameterVolatile', N'Kontrolliert den Store Control Parameter Volatile Service (Setzt Control Parameter vor einem Restart und überprüft, ob die Daten noch erhalten geblieben sind)', CAST(N'2015-10-14' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (81, N'VoltageMode', N'Testet den Voltage Mode auf dem IC2H2 Controller (Es werden 1000 zufällige Zielspannungen gesetzt und die Hysteresefunktion im unteren und oberen Spannungsbereich überprüft). Zusätzlich wird der User Faktor und Offset der Analog Actual und Target Position kontrolliert. Die Spannung wird über die NI Hardware gespiessen', CAST(N'2016-09-16' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (82, N'WarningBitmap', N'Es werden alle Warnungen kontrolliert. Es wird auch der i:51 (Get Warnings) Befehl kontrolliert. Von Vorteil mit Cluster und PFO Option', CAST(N'2017-05-10' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (83, N'ZeroAdjustExecute', N'Führt die Execute Zero Adjust Funktion aus(Unter allen verschiedenen Sensor Avaiable, Sensor Enable, Sensor Filter, Sensor Selection Einstellungen)', CAST(N'2015-02-20' AS Date), N'Stucki Andreas')
INSERT [dbo].[TestInformation] ([Id], [Name], [Description], [CreationDate], [CreationAuthor]) VALUES (84, N'ZeroAdjustReferencePressureValue', N'Beim ZeroAdjust Parameter werden die SetReference Grenzen geprüft.', CAST(N'2014-07-14' AS Date), N'Stucki Andreas')
